import React from "react";
import NavBar from "./NavBar";
import { Link } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faXmark } from "@fortawesome/free-solid-svg-icons";


const SignIn = () => {
  return (
    <div className="">
      <Link to="/">
        <h6 className="yell text-3xl ml-6 mt-7 font-bold ">IIT BHILAI</h6>
      </Link>
      <div className="center text-white bg-black w-1/3 h-2/3 rounded-lg p-3">
        <div className="flex justify-between">
          <div>
            <h3 className="text-xl text-white">Welcome Back</h3>
            <h3 className="text-2xl text-white">Sign In</h3>
          </div>
          <Link to="/"><FontAwesomeIcon
            icon={faXmark}
            className="text-2xl  mb-10 text-white "
          />
          </Link>
        </div>

        <form className="p-2  ">
          <input placeholder="Phone Number"
          type="number"
          className="w-full h-10 bg-black mb-5 text-white border-2 border-white text-sm rounded-xl p-3 ">
          </input>
          <input placeholder="Password"
          type="password"
          className="w-full h-10 bg-black text-white border-2 border-white text-sm rounded-xl p-3">
          </input>
          <Link to="" className="" ><h2 className="text-right mt-2 font-light">Forgot password?</h2></Link>
          <button type="submit" className="bg-yell w-full text-black border-white h-10 rounded-md">Continue</button>
        </form>
      </div>
    </div>
  );
};

export default SignIn;
